import ExpenseItem from './exprenseItem';
function Exprense(){
  const exprenses= [
    {
      id:"e1",
      title:"Car Insurance",
      amount:216,
      date:new Date(2020,7,14)
    },
    {
      id:"e2",
      title:"New Desk",
      amount:450,
      date:new Date(2020,8,19)
      
    },
    {
      id:"e3",
      title:"New TV",
      amount:800,
      date:new Date(2021,8,14)
      
    }

  ];
    return ( 
    <div>
        <ExpenseItem 
        title={exprenses[0].title}
        amount={exprenses[0].amount}
        date={exprenses[0].date}
        ></ExpenseItem>
          <ExpenseItem 
        title={exprenses[1].title}
        amount={exprenses[1].amount}
        date={exprenses[1].date}
       ></ExpenseItem>
          <ExpenseItem 
        title={exprenses[2].title}
        amount={exprenses[2].amount}
        date={exprenses[2].date}
       ></ExpenseItem>
        </div>
    );
}
export default Exprense;
